"""
Author: Anger36
Date: 19-5-8
Describe:
给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度。

示例 1:

输入: "abcabcbb"
输出: 3
解释: 因为无重复字符的最长子串是 "abc"，所以其长度为 3。
示例 2:

输入: "bbbbb"
输出: 1
解释: 因为无重复字符的最长子串是 "b"，所以其长度为 1。
示例 3:

输入: "pwwkew"
输出: 3
解释: 因为无重复字符的最长子串是 "wke"，所以其长度为 3。
     请注意，你的答案必须是 子串 的长度，"pwke" 是一个子序列，不是子串。

"""

from tools.common import get_func_time


@get_func_time
def length_longest_substring(s: str):
    """
    :type s: str
    :rtype: int, str
    """
    n = len(s)
    max_len = 0
    max_str = ''
    for i in range(n):
        for j in range(i + 1, n):
            if s[j] in s[i:j]:
                if j - i > max_len:
                    max_len = j - i
                    max_str = s[i:j]
                break
        else:
            if n - i > max_len:
                max_len = n - i
                max_str = s[i:]
                break
    return max_len, max_str


@get_func_time
def length_longest_substring2(s: str):
    i = j = ans = 0
    n = len(s)
    max_str = ""
    while i < n and j < n:
        if s[j] not in s[i:j]:
            if j - i + 1 > ans:
                ans = j - i + 1
                max_str = s[i:j + 1]
            j += 1
        else:
            i += 1
    return ans, max_str


@get_func_time
def length_longest_substring3(s: str):
    i = j = ans = 0
    n = len(s)
    max_str = ""
    while i < n and j < n:
        if s[j] not in s[i:j]:
            if j - i + 1 > ans:
                ans = j - i + 1
                max_str = s[i:j + 1]
            j += 1
        else:
            i = i + 1 + s[i:j].index(s[j])
            j += 1
    return ans, max_str


@get_func_time
def length_longest_substring6(s):
    ans = 0
    start = 0
    end = 0
    str_set = set()
    while start < len(s) and end < len(s):
        str_len = len(str_set)
        str_set.add(s[end])
        if str_len != len(str_set):
            end += 1
            ans = max(ans, end - start)
        else:
            str_set.remove(s[start])
            start += 1
    return ans


